  `limit_kredit` decimal(15,2) DEFAULT '0.00',
  `saldo_poin` int DEFAULT '0',
  `status` enum('aktif','nonaktif','blacklist') COLLATE utf8mb4_unicode_ci DEFAULT 'aktif',
  `dibuat_pada` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
